import "./ConvertUrl.css";

function ConvertUrl() {
  const [urlList, setUrlList] = userState(null);

  const shortUrlList = () => {
    setUrlList("Test Url list");
  };

  return (
    <div className="container">
      <h1>URL SHORTENER</h1>
      <div class="information">
        <form class="row g-2">
          <div class="col-9">
            <label for="inputPassword2" class="visually-hidden">
              Password
            </label>
            <input
              type="text"
              class="form-control form-control-lg"
              id="inputPassword2"
              placeholder="Password"
            />
          </div>
          <div class="col-3">
            <button class="btn btn-primary btn-lg mb-3">Shorten</button>
          </div>
        </form>
      </div>
    </div>
  );
}

export default ConvertUrl;
